const MM = 100;
const mm = 1;
function dn(x)
{
	y = x * (MM - mm) + mm;
	return Math.round(y);
}

const config = {
  
  hiddenLayers: [32,32,16], // array of ints for the sizes of the hidden layers in the network
  activation: 'sigmoid' // supported activation types: ['sigmoid', 'relu', 'leaky-relu', 'tanh']
};

var net = new brain.NeuralNetwork(config);

var nn = net.fromJSON(JSON.parse(jnn));

console.log("ok");

function norm(x)
{
	return (x - mm) / (MM - mm);
}
var good_cnt = 0;
var bad_cnt = 0;
var data = [];

// bad_cnt = 2296, good_cnt = 1607
function getBN(sf,x_tgt)
{
	var input = [norm(window.Vars.obstacle.x_up * sf).toFixed(3), norm(window.Vars.obstacle.y_up * sf).toFixed(3), norm(window.Vars.obstacle.x_down * sf).toFixed(3), norm(window.Vars.obstacle.y_down * sf).toFixed(3)];
	if(input[1] < 0 || input[3] < 0) 
	{
		console.log("cacat");
	}
	var bn = net.run(input);
	var dp = {input: input, output: [0,0]};
	bn[0] = dn(bn[0]) / sf;
	bn[1] = dn(bn[1]);
	var test = testEllipse(x_tgt, window.Vars.obstacle.x_up * sf, window.Vars.obstacle.y_up, window.Vars.obstacle.x_down * sf, window.Vars.obstacle.y_down, bn[0], bn[1]);	
	if(test > 1)
	{
		console.log(test);
		bn = ellipseParams(x_tgt, window.Vars.obstacle.x_up * sf, window.Vars.obstacle.y_up, window.Vars.obstacle.x_down * sf, window.Vars.obstacle.y_down);
		dp.output = [norm(bn[0] * sf).toFixed(3),norm(bn[1]).toFixed(3)];
		data.push(dp);
		bad_cnt++;
	}
	else
	{
		good_cnt++;
	}
	
	return bn;
}

var total_path = 0;
function tallyPath(orig, tgt)
{
	total_path += Math.sqrt(Math.pow((tgt.x - orig.x),2) + Math.pow((tgt.y - orig.y),2) + Math.pow((tgt.z - orig.z),2));
}

var total_time = 0;
async function moveToOD(Params, Vars, tgt)
{
	await timeout(50);
		if(window.Vars.obstacle == null)
		{
			await driveTo(Params, Vars, tgt);
			return;		
		}
		
		

		var pointCloud = null;
		
		var d = new Date();
		var start_time = d.getTime();

		var cur_x = parseFloat($("#x").val() + "");
		var cur_y = parseFloat($("#y").val() + "");
		var cur_z = parseFloat($("#z").val() + "");
		var cur_rx = parseFloat($("#rx").val() + "");
		var cur_ry = parseFloat($("#ry").val() + "");
		var cur_rz = parseFloat($("#rz").val() + "");
		
		var increment_x = (tgt.tcp.x - cur_x) / 101;
		var increment_y = (tgt.tcp.y - cur_y) / 101;
		var increment_z = (tgt.tcp.z - cur_z) / 101;
		
		var max_z = Vars.obstacle.y_up;
		
		var sf = 100 / window.Vars.obstacle.dist;
		
		//var points = generateEllipsePoints(100,bn[0],bn[1]);
		var x_tgt = 100;
		
		var bn = getBN(sf,x_tgt);
		
		var points = [];
		
		for(var i=0;i<101;i++)
		{
			var target = {tcp: {}};
			target.tcp.x = cur_x + (i + 1) * increment_x;
			target.tcp.y = cur_y + (i + 1) * increment_y;

			var bnChanged = false;
			if(window.Vars.obstacle != null && Math.abs(window.Vars.obstacle.x_up - window.Vars.obstacle.x_down) > 0.01)
			{
				var bn1 = getBN(sf,x_tgt);
				if(bn1[0] > bn[0])
				{
					bn[0] = bn1[0];		
					bnChanged = true;
				}
				if(bn1[1] > bn[1])
				{
					bn[1] = bn1[1];		
					bnChanged = true;
				}
			}

			var x = i - 50;
			var b = bn[0];
			var n = bn[1];
			
			var ey = b * Math.pow((1 - Math.pow(Math.abs(x/(x_tgt/2)),n)),(1/n));
			
			target.tcp.z = cur_z + ey + (i + 1) * increment_z;
			
			target.tcp.rx = cur_rx;
			target.tcp.ry = cur_ry;
			target.tcp.rz = cur_rz;
			
			tallyPath(Robot.tcp,target.tcp);
			
			const material = new THREE.MeshBasicMaterial( {color: 0x000000} );
			var geometry = new THREE.SphereGeometry( 0.02, 0.02, 0.02 );
			var sphere = new THREE.Mesh( geometry, material );
			sphere.position.set(target.tcp.x / 100,target.tcp.y / 100,(target.tcp.z - 80) / 100);
			window.scene.add( sphere );
			points.push(sphere);
			
			if(i < 100) 
			{
				await driveTo(Params, Vars, target);
			}
			else
			{
				await driveTo(Params, Vars, tgt);
			}
			
		}		
		
		
		Robot.origin = null;
		var pnts = [...points];
		setTimeout(function() {
			for(var i=0; i<pnts.length; i++)
			{
				window.scene.remove(pnts[i]);
			}
		}, 5000);
		var d = new Date();
		var stop_time = d.getTime();
		total_time += stop_time - start_time;

}
